【車種別取付説明書付き！保証1年付き！】<br><br>

■商品説明<br>
純正のキーレスエントリ連動でハザード点滅するアンサーバックキットに<br>
サイレン本体が追加され、セットになりました。<br>
本製品はアンサーバックサイレン機能とハザード点滅機能に特化した製品になります。 <br>
純正キーレスエントリーが作動するときに　アンサーバック・サイレンが鳴り、ハザードランプを点滅させる機能があります。<br><br>

ドアロック時に1回(キュ!)、アンロック時に2回(キュキュ!)とサイレンがチャープ音を鳴らします。<br><br>

■取り付けについて<br>
ほとんどのトヨタ車は本体のみでハザード点滅可能ですが、トヨタ車以外の車両でハザード点滅させる場合は、リレーオプションが別途必要です。ハザードスイッチがマイナスコントロール仕様の場合はトヨタ車以外でもリレーオプションは不要です。 <br>
<br>
■誤動作防止について<br>
※本製品の全ての機能はACCオン時にはキャンセルされますので走行中、エンジン始動中のドアロック、アンロック動作は無反応となります。 <br><br>

【アンサーバック音】<br>
サイレン鳴動回数(ロック時1回/アンロック時2回、ロック時2回/アンロック時3回)<br>
鳴動時間(音色7種)<br>
鳴動間隔(15種)<br>
の組み合わせ、全210通りから選択可能です。 <br>
<br>
ドアロックでキュ!<br>
アンロックでキュキュ!<br><br>







<style type="text/css">

/***買い物かごまわり全ボタン・入力欄共通***/
input#normal_basket_10009841,input#normal_basket_10014922,input#normal_basket_10023802,normal_basket_10026828,normal_basket_10026855,normal_basket_10026661,normal_basket_10023647,normal_basket_10026632 {
width: 252px;
height: 52px;
white-space: nowrap;
text-indent: 110%;
overflow: hidden;
background:url(http://www.rakuten.ne.jp/gold/auc-cb-if/img/cartbutton.jpg) no-repeat;
border:none;
}

/***「個数」部分***/
input#units{
border:solid #ccc 1px;
background:#fff;
width:30px;
height:20px;
line-height:20px;
text-align:center;
}

/***「お問合せ」ボタン***/
font input{
border:solid #ccc 1px;
background:#eeeeee;
background-image:none;
}

/***「項目選択肢部分」***/
.inventory input{
background:#fff;
}

</style>


